import './Header.scss';

const Header = () => {
	return (
		<div className='header'>
			<div className='header-container'>
				<div className='header-left'>
					<a href=''>Home</a>
				</div>
				<div className='header-right'>
					<a className='button primary-button' href=''>
						Sign Up
					</a>
					<a href=''>Log In</a>
				</div>
			</div>
		</div>
	);
};

export default Header;
